import React, { useEffect } from 'react';
import Cell from './Cell';


const Row = ( { row, i, grid, setGrid }) => {

  useEffect(() => {
    console.log('ROW COMPONENT')
  }, [])

  return (
    <div style={{display: 'grid', textAlign: 'left', 
                 gridTemplateColumns: '1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr'}}>
      {row.map((cell, j) => {
        return <Cell cell={cell} key={i + j} j={j} i={i} grid={grid} setGrid={setGrid}/>
      })}
    </div>
  )
}

export default Row
